import React from "react";
import { Link } from "react-router-dom";

const Logout = () => {
  const handleLogout = () => {
    <Link to="/"></Link>
  };
  return (
    <div>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
};

export default Logout;
